var output = document.querySelector('.depositOutput');

var depositLists = {
  postPerPage: 5,
  currentPage: 1,
  optionsLength: 0,
  selected: 1,
  result: null
};

var init = function init() {
  var data = arguments.length > 0 && arguments[0] !== undefined ? arguments[0] : data;

  console.log('ready');
  depositLists.result = data;
  // console.log(depositLists.result);
  loadPage(1);
  // console.log(depositLists.optionsLength);
  var pageSelector = document.createElement('select');
  for (var i = 0; i < depositLists.optionsLength; i++) {
    var pageValue = document.createElement('option');
    pageValue.value = i + 1;
    pageValue.textContent = i + 1;
    pageSelector.appendChild(pageValue);
    pageSelector.addEventListener('change', function (e) {
      loadPage(e.target.value);
      depositLists.selected = parseInt(e.target.value);
    });
  }
  $('.pagination .cannotBeRemove:last-child').before(pageSelector);
};

var loadPage = function loadPage(pg) {
  $('.depositOutput').html('');

  // pagination.innerHTML = '';
  depositLists.currentPage = pg;
  var startPost = (depositLists.currentPage - 1) * depositLists.postPerPage;
  var totalPages = Math.ceil(depositLists.result.length / depositLists.postPerPage);
  var endPost = startPost + depositLists.postPerPage > depositLists.result.length ? depositLists.result.length : startPost + depositLists.postPerPage;
  depositLists.optionsLength = totalPages;

  for (var x = 0; x < totalPages; x++) {
    if (totalPages <= 1) {
      $('.pagination').css('display', 'none');
    }
  }

  for (var _x2 = startPost; _x2 < endPost; _x2++) {
    var main = depositLists.result[_x2];
    var div = document.createElement('div');
    div.classList.add('itemContainer', 'itemContainer__records');
    div.style.height = 'auto';
    var div_id = document.createElement('div');
    var div_time = document.createElement('div');
    var div_method = document.createElement('div');
    var div_value = document.createElement('div');
    var div_status = document.createElement('div');
    div_id.textContent = "\u55AE\u865F\uFF1A" + main.id;
    div_time.textContent = "" + main.time;
    div_method.textContent = "\u5132\u503C\u65B9\u5F0F\uFF1A" + main.methods;
    div_value.textContent = "\u91D1\u984D\uFF1A" + main.value;
    div_status.innerHTML = "\u72C0\u614B\uFF1A" + (main.status ? "<span class=\"success\">\u6210\u529F</span>" : '<span class="failure">申請中</span>');
    div.appendChild(div_id);
    div.appendChild(div_time);
    div.appendChild(div_method);
    div.appendChild(div_value);
    div.appendChild(div_status);

    output.appendChild(div);
  }
};

window.addEventListener('load', function () {
  init(data);
});
$('.pagination li:last-child').click(function (e) {
  e.preventDefault();

  if (depositLists.selected === depositLists.optionsLength) {
    return false;
  } else {
    depositLists.selected += 1;
    loadPage(depositLists.selected);
    $('.pagination select').val(depositLists.selected);
  }
  console.log('next clicked!');
  console.log('current:', depositLists.selected);
});
$('.pagination li:first-child').click(function (e) {
  e.preventDefault();

  if (depositLists.selected === 1) {
    return false;
  } else {
    depositLists.selected -= 1;
    loadPage(depositLists.selected);
    $('.pagination select').val(depositLists.selected);
  }
  console.log('prev clicked!');
  console.log('current:', depositLists.selected);
});
